import React, { Component } from "react";
import { Section } from "../Components";

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div>
          <Section primary>
            <div
              style={{ fontSize: "3em", fontWeight: "bold" }}
            >{`We <3 people who code`}</div>
            <div style={{ fontSize: "1.2em", maxWidth: "300px", textAlign :"center",margin :"5%" }}>
              We build products that empower developers and connect them to
              solutions that enable productivity, growth, and discovery.
            </div>
          </Section>
        </div>
      </>
    );
  }
}

export default Homepage;
